function testImage(e){return new Promise(t=>{let s=new Image;s.onload=()=>t(!0),s.onerror=()=>t(!1),s.src=e})}async function displayTestResult(){try{let e=document.getElementById("test-result-image"),t=await testImage("https://failure.sainternet.xyz");if(t)consoleWrapper("[Test] Failure"),e.src="https://failure.sainternet.xyz";else{let s=await testImage("https://success.sainternet.xyz");s?(consoleWrapper("[Test] Success"),e.src="https://success.sainternet.xyz"):consoleWrapper("[Test] Unknown")}}catch(n){consoleWrapper("[Test] Error","error")}}consoleWrapper("[Test] Loaded"),window.onload=displayTestResult;
